        if(change == "hide"){      
          if(self.isTintActive){ 

            if(self.options.zoomTintFadeOut){
              self.zoomTint.stop(true, true).fadeOut(self.options.zoomTintFadeOut);
            }
            else{self.zoomTint.hide();}
            self.isTintActive = false;        
          }      
        }
